import 'bootstrap/dist/css/bootstrap.min.css';
import { Nav, Navbar, Container } from "react-bootstrap"
import logo from "../assets/seenohairlogo.png"
import {BrowserRouter as Router, Routes, Route, Link, } from 'react-router-dom';
function navbar() {

return(
    <>
  <Navbar classname="p-4" bg="dark" variant="dark">
    <Navbar.Brand classname="h-25 w-50" href="/"><img className="img-thumbnail h-25 img-fluid border-0 rounded ms-4 mb-2" src={logo}></img></Navbar.Brand>
    <Nav className="me-auto">
      <Nav.Link to="/Home" href="/">Home</Nav.Link>
      <Nav.Link href="#features">Features</Nav.Link>
      <Nav.Link href="#pricing">Pricing</Nav.Link>
      <Nav.Link href="/login">Login</Nav.Link>

    </Nav>
  </Navbar>
  <br></br>
</>
);


}
export default navbar;
